				["targetkind"] = "npc",
				["targetname"] = "Yan",
				["complete"] = "This tail came from a crocolisk? Funny, we don't get many crocs this far upstream.\n\nHave you seen some of the enormous fruits and vegetables that our farmers can grow? Your crocolisk grew so large for the same reason - there's something in the water.\n\nWhat it is, we're not quite sure... but we count it among our blessings. Humongous vegetables are great. The odd giant crocolisk every now and again is really just a side effect.",
